import React, {useState,useEffect} from 'react';
import Videolist from './components/video_list/video_list';
import Navbar from './components/navbar';

function App() {
  const [videos,setVideos]= useState(['ddd']);

  useEffect(()=>{
    const requestOptions = {
      method: 'GET',
      redirect: 'follow'
    };

    fetch("https://youtube.googleapis.com/youtube/v3/videos?part=snippet&chart=mostPopular&maxResults=50&key=AIzaSyBobrlrOAiEsXROMGfZIizMewXmtK0iidM ", requestOptions)
      .then(response => response.json())
      .then(result => setVideos(result.items))
      .catch(error => console.log('error', error));
  },[]);
 return(<> <Navbar /> <Videolist videos={videos}/></>)
}

export default App;
